import React, { Component } from 'react';
import { Card, Button, Form } from 'react-bootstrap';
class Post extends Component {
    render() {
        return (
            <Form>
                <Card>
                    <Card.Header>
                        <Form.Control type="text" placeholder="Title" />
                    </Card.Header>
                   
                </Card>
            </Form>
        );
    }
}

export default Post;
